import './App.css';
import './miCss.css';
import imagen from './imagen.webp';

function App() {
  let nombre=["Moises", "juan"];
  let caja = <div>Nombre</div>;
  return (
    <div className="fondo">
     <h1>Curso de React</h1>
     <div>{caja}</div>
     <img src={imagen} className="img"></img>
     <input value={nombre[0]}></input>
     <br/>
    </div>
  );
}

export default App;
